import React from 'react';
import NfValidator from './components/NfValidator';

function App() {
  return (
    <div className="min-h-screen bg-gray-100 py-8">
      <div className="container mx-auto px-4">
        <NfValidator />
      </div>
    </div>
  );
}

export default App;
